import React from 'react';
import TodoItem from './TodoItem';

import {
    Card,
    Checkbox,
    IconButton,
    List,
    ListItem,
    ListItemIcon,
    ListItemText,
} from "@material-ui/core";

function Todo({ todos }) {
    return (
        <>
            {todos.map((todo) => (
                    <TodoItem
                        todo={todo}
                        key={todo.id}
                    />
                ))}
        </>
    );
}

export default Todo;
